import React, {useState} from "react";
import LoginPage from "./components/LoginPage";
import Home from "./components/Home";
function App() {
  const[isLogin, setIsLogin] = useState(false)
  console.log(isLogin)
  const setLogin=()=>{
    setIsLogin(true)
  }
  return (
    <div>
     {!isLogin && <LoginPage setIsLogin={setLogin}/>}
     {isLogin && <Home />}
    </div>
  );
}

export default App;
